import React from 'react';
import Paper from '@mui/material/Paper';
import { Box } from '@mui/material';

const ProductCard = () => {
  return (
      <Box sx={{
            display: 'flex',
            flexWrap: 'wrap',
      }}>
            <Paper elevation={3}>Same Size</Paper>
      </Box>
  )
}

export default ProductCard;
